import React, { Component } from 'react';
import './App.css';
import AppBar from '@material-ui/core/AppBar';

function App() {
  return (
    <div className="App">
      <AppBar color="primary" position="static">
        <h1>My Header</h1>
      </AppBar>
    </div>
  );
}

export default App;
